Insert into PLACE (PNO,PCONTENTSID,PTITLE,PLABEL,PADDR,PROAD,PINTRO,PLAT,PLONG,PTEL,PIMG,PTHUMB,POPENTIME,PCLOSETIME) values (597,'CNTS_000000000000597','아라고나이트 온천(디아넥스호텔)','서귀포시','제주특별자치도 서귀포시 안덕면 상천리 380-7','제주특별자치도 서귀포시 안덕면 산록남로762번길 71','무더운 여름 시원한 수영장을 자연스레 찾는 것처럼 겨울철에는 뜨끈한 온수에 몸을 담그고 피로를 푸는 경우가 있다. 2001년 전까지만 해도 전문가들은 “제주도에는 온천 부존 가능성이 없다”고 했다. 하지만 이 정설을 뒤집고 제주에서 유일하게 아라고나이트 고온천수가 발견되었다. 수억 년 전 역사로 거슬러 올라가는 아라고나이트 고온천수 시설은 디아넥스호텔이 자부하는 최고의 힐링시설이다. 이 온천수는 300만 년 전에 모양을 갖춘 지하 화강암 위에 순수한 물이 제주 땅 중심으로 스며들면서 각종 미네랄을 함유하며 생성되었다는 게 전문가들의 의견.',33.303474,126.39206,'064-793-6005','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/40a75124-90a5-4d33-9617-8542d8119276.jpg','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/ed59390a-40e1-49c1-89d4-3c9b0b4cb026.jpg','09:00','21:00');
Insert into PLACE (PNO,PCONTENTSID,PTITLE,PLABEL,PADDR,PROAD,PINTRO,PLAT,PLONG,PTEL,PIMG,PTHUMB,POPENTIME,PCLOSETIME) values (970,'CNTS_000000000000970','제주추사관','서귀포시','제주특별자치도 서귀포시 대정읍 안성리 1661-1','제주특별자치도 서귀포시 대정읍 추사로 44','추사 김정희는 1840년 윤상도 옥사사건에 연루되어 약 9년간 제주에서 귀양살이를 했다. 대정읍에 있는 추사관은 김정희 선생이 유배 생활을 하며 남긴 흔적을 모은 곳이다. 그가 살았던 초가집도 옛 모습 대로 복원되어 있다. 추사관에는 김정희 선생이 쓴 현판 글씨와 아내, 지인들에게 보낸 편지 등이 전시되어 있다.',33.25022,126.27838,'064-760-3406','https://api.cdn.visitjeju.net/photomng/imgpath/201804/30/c3e6e078-fb6f-4374-839a-9bf4d6d0f70e.jpg','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201804/30/642b3fe9-a866-4939-af64-29475c9262dc.jpg','09:00','18:00');
