Insert into PLACE (PNO,PCONTENTSID,PTITLE,PLABEL,PADDR,PROAD,PINTRO,PLAT,PLONG,PTEL,PIMG,PTHUMB,POPENTIME,PCLOSETIME) values (21527,'CNTS_000000000021527','삼다수숲길','제주시','제주특별자치도 제주시 조천읍 교래리 614','제주특별자치도 제주시 조천읍 교래리 614','삼다수 숲길은 지역 주민들이 오가던 임도를 정비해 만든 비교적 최근에 조성된 탐방로이다. 원래 이 지역은 말 방목터이자 사냥터였는데 1970년대 심은 삼나무들이 30m 남짓한 거목으로 성장해 빼곡하게 숲을 메웠다. 삼다수를 생산하는 제주특별자치도 개발공사와 교래리 주민들은 숲 사이에 길을 닦아 ‘삼다수숲길’이란 이름을 붙여 2010년 개장했다. 태고의 경관미를 숨겨놓은 삼다수숲길은 2010년 우리나라의 아름다운 숲으로 선정되기도 했다.',33.428387,126.67257,'--','https://api.cdn.visitjeju.net/photomng/imgpath/202002/25/bdc65b79-da50-4f55-b614-34f8efaec7c4.jpg','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/25/885aa9fc-a0b7-47e6-b9e8-9f56677b8cd3.jpg',null,null);
